public static boolean isRegistered(@Nonnull Item item) {
    ItemDeletion instance = instance();
    if (instance == null) {
        return false;
    }
    instance.lock.readLock().lock();
    try {
        return instance.registrations.contains(item);
    } finally {
        instance.lock.readLock().unlock();
    }
}

