public static void deregister(@Nonnull Item item) {
    ItemDeletion instance = instance();
    if (instance != null) {
        instance.lock.writeLock().lock();
        try {
            instance.registrations.remove(item);
        } finally {
            instance.lock.writeLock().unlock();
        }
    }
}

